const BackgroundDialog = ({ onSelectBackground, onClose }) => {
  const options = ["Starfield", "Aurora", "Snowfall", "Bubbles"];

  return (
    <div className="background-dialog">
      <h3>Select Background</h3>
      <ul>
        {options.map((option) => (
          <li key={option}>
            <button onClick={() => onSelectBackground(option)}>{option}</button>
          </li>
        ))}
      </ul>
      <button onClick={onClose}>Close</button>
    </div>
  );
};

export default BackgroundDialog;
